"Cyan": "#37BC9B",
"Green": "#8CC152",
"Red": "#E9573F",
"Yellow": "#F6BB42",
};
class Navbar extends Component {



  render() {
    return (
      <nav style={{backgroundCoolor: '#e3f2fd'}} className="navbar navbar-expand-sm">
        <ul class="navbar-nav ">
          <li className="nav-item">MERN LOGIN SYSTEM</li>
        </ul>
      </nav>
    );
  }
}

export default Navbar;
